def gameOfThrones(s):
    llist = []
    a = 0
    for i in s:
        if i in llist:
            continue
        if s.count(i)%2 == 1:
            a += 1
        else:
            pass
        llist.append(i)
        if a > 1:
            print(a)
            return 'NO'
    if a >= 1:
        print(a)
        return 'NO'
    else:
        return 'YES'



s = ''
print(gameOfThrones(s))